const Moviedetails = () => {
    let {location}=useParams()
    let{id}=useParams()
    const [movie,setmovies]=useState<Imovies>()
  useEffect (
   
    ()=>{
      const helper = async ()=>{
      const movies= await getmoviedetails(location,id);
      setmovies(movies);
      }
      helper()
    }

  ,[]);

    console.log(movies)
    return ( 
        <div>Movie Details</div>
     );
}
 
export default Moviedetails;
